import { makeStyles } from "@mui/styles"

const homeStyles = makeStyles (() =>({
    card:{
        maxWidth: 345,
        background: '#272727',
        color: '#ffffff',
        borderRadius:'',
        border: '30px',
        borderColor: '#ffffff',
    },
    title:{
        marginLeft: '25px',
    },
    }
))

export default homeStyles
